import {Form,Row,Col,Button} from 'react-bootstrap/';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Form>
          <div className="Form-data">
          <Row>
            <Col sm={5}>
              <Form.Control placeholder="Amount" />
            </Col>
            <Col sm={5}>
              <Form.Control placeholder="Duration" />
            </Col>
            <Col sm={2}>
              <Button size="" variant="warning">OK</Button>
            </Col>            
          </Row>
          </div>
        </Form>

      </header>
             <div className="display-data">
            <p>Monthly Installment: <b>5672.63 EUR</b></p>
          </div>
    </div>
  );
}

export default App;
